Trick 'r Treat (2008) Alternatieve titel: Trick or Treat 

Canada / Verenigde Staten
Thriller / Horror
100 minuten

geregisseerd door Michael Dougherty
met Brian Cox, Dylan Baker en Leslie Bibb

Vier verhalen die plaatsvinden in een stadje tijdens Halloween: we zien een seriemoordenaar die vergiftigd snoep produceert, een groep kinderen die een geheim ontdekken over het stadje, een jonge vrouw die achtervolgd wordt door een gemaskerde stalker en een bejaarde die maar niet afkomt van een duivelse trick-or-treater.

